import React, {useState} from "react";
import Product from './../components/Product'


const CataloguePage = (props) => {

    const {shop} = props
    if(!shop) return null;
    return(
    <div className="row">
       
        <div className="fields">
            {
        shop.map(shop=>
            <div key={shop.id}>
            <Product 
                key={shop.id} 
                shop={shop}
                {...shop}/>
                
            </div>
        )}
        </div>
    </div>
    )
}

export default CataloguePage;
